import React, { Component } from "react";

class Detail extends Component {

  render() {
    return (
      <main className="user">
        <Link className="back" to="/"><IoArrowBackCircle /></Link>
        <div className="title">
          나의 정보
        </div>
        <section className="info">
          <div>
            login/logout
          </div>
          <div>
            information
          </div>
        </section>
      </main>
    );
  }

}

export default Detail;
